import React from 'react'
import styled from 'styled-components'

const Container =styled.div`
display:flex;
gap:10px;
margin:30px 0px;
`;

const Avatar =styled.img`
width: 50px;
height: 50px;
border-radius: 50%;
`;

const Details = styled.div`
display:flex;
flex-direction:column;
gap:10px;
`;

const Name = styled.span`
font-size:13px;
font-weight:500;
`;

const Date = styled.span`
font-size:12px;
font-weight:400;
margin-left:5px;
color: ${({ theme }) => theme.textSoft};
`;

const Text = styled.span`

`;


export default function Comment() {
  return (
    <Container>
        <Avatar src="https://assets-prd.ignimgs.com/2022/02/08/toppokemongamesofalltime-blogroll-1644358512665.jpg"/>
        <Details>
            <Name>WQQ</Name>
            <Date>2020/01/08</Date>
            <Text>aaaaaaaa</Text>
        </Details>
    </Container>
  )
}
